import React from "react";

function App() {
  const employee = [
    "Serhat Genç",
    "Mehmet Genç",
    "Ayşe Genç",
    "Ferhat Genç",
    "Seda Genç",
  ];
  return (
    <div>
      <h1> Employees {employee.length}</h1>
    </div>
  );
}

export default App;
